collation_table make_save_load_table()
{
#ifdef LIMIT_TESTING_FOR_CI
    std::string const table_str(data::ja::standard_collation_tailoring());
    return tailored_collation_table(
        table_str,
        "ja::standard_collation_tailoring()", error, warning);
#else
    if (!exists(boost::filesystem::path("ja_standard.table"))) {
        std::string const table_str(data::ja::standard_collation_tailoring());
        collation_table table = tailored_collation_table(
            table_str,
            "ja::standard_collation_tailoring()", error, warning);
        save_table(table, "ja_standard.table.3");
        boost::filesystem::rename("ja_standard.table.3", "ja_standard.table");
    }
    return load_table("ja_standard.table");
#endif
}
